def switch_item(slot):
    """
    Switches to a different item loadout.

    Parameters:
    - slot: The loadout slot to switch to (1-3)
    """
    if slot == 1:
        io_env.key_press('1')
    elif slot == 2:
        io_env.key_press('2')
    elif slot == 3:
        io_env.key_press('3')
